import React from "react";
import TableList from "./TableList";
import { loadContributors } from "./../logic/contributorsActions";

function Dashboard() {
  return (
    <>
      <h1>Hello Contributors List</h1>
      <button
        onClick={(event) => {
          event.preventDefault();
          loadContributors();
        }}
      >
        Get users!
      </button>
      <TableList />
    </>
  );
}

export default Dashboard;
